import React from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";
import {Dashboard} from "../pages/Dashboard"

interface NavigationI {
    title:string,
    path:string  
}

interface NavigationProps{
    data:NavigationI[];
}

const Navigation: React.FC<NavigationProps> = ({ data }: NavigationProps) => {
    return (
        <Router>
            <div>
                <ul>
                    {data.map((item) => {
                        return (
                            <li>
                                <Link to={item.path}>{item.title}</Link>
                            </li>
                        )
                    })}
                </ul>
                <Routes>
                    {data.map((item) => {
                        return(
                            <Route path={item.path} element={<Dashboard/>} />
                        )
                        
                    })}
                </Routes>
            </div>
        </Router>
    )
}

export default Navigation;
